pragma solidity >=0.4.0 <0.7.0;

library PostMapping {event __CoveragePostMapping(string fileName, uint256 lineNumber);
event __FunctionCoveragePostMapping(string fileName, uint256 fnId);
event __StatementCoveragePostMapping(string fileName, uint256 statementId);
event __BranchCoveragePostMapping(string fileName, uint256 branchId, uint256 locationIdx);
event __AssertPreCoveragePostMapping(string fileName, uint256 branchId);
event __AssertPostCoveragePostMapping(string fileName, uint256 branchId);

    struct Post {
        mapping(uint => IndexValue) data;
        KeyFlag[] keys;
        uint size;
    }

    struct IndexValue {
        uint keyIndex;
        string name;
        string description;
        string url;
        address payable owner;
    }

    struct KeyFlag { uint key; bool deleted; }

    function insert(
        Post storage self,
        string memory name,
        string memory description,
        string memory url,
        address payable owner
    ) internal returns (bool) {emit __FunctionCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',1);

emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',27);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',1);
if (self.size == 0) {emit __BranchCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',1,0);self.keys.length++;}else { emit __BranchCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',1,1);}


emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',29);
        self.size++;
emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',30);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',2);
self.data[self.size].name = name;
emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',31);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',3);
self.data[self.size].description = description;
emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',32);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',4);
self.data[self.size].url = url;
emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',33);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',5);
self.data[self.size].owner = owner;

emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',35);
        self.keys.length++;
emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',36);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',6);
self.data[self.size].keyIndex = self.size;
emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',37);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',7);
self.keys[self.size].key = self.size;

emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',39);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',8);
return true;
    }

    function iterate_get(
        Post storage self,
        uint keyIndex
    ) internal      returns (
        uint key,
        string memory name,
        string memory description,
        string memory url,
        address payable owner
    ) {emit __FunctionCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',2);

emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',52);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',9);
key = self.keys[keyIndex].key;
emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',53);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',10);
name = self.data[key].name;
emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',54);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',11);
description = self.data[key].description;
emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',55);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',12);
url = self.data[key].url;
emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',56);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',13);
owner = self.data[key].owner;
    }

    function remove(Post storage self, uint key) internal {emit __FunctionCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',3);

emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',60);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',14);
self.keys[self.data[key].keyIndex].deleted = true;
emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',61);
        delete self.data[key];
    }

    function contains(Post storage self, uint key) internal      returns (bool) {emit __FunctionCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',4);

emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',65);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',15);
return self.data[key].keyIndex > 0;
    }

    function iterate_start(Post storage self) internal      returns (uint keyIndex) {emit __FunctionCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',5);

emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',69);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',16);
return iterate_next(self, uint(0));
    }

    function iterate_valid(Post storage self, uint keyIndex) internal      returns (bool) {emit __FunctionCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',6);

emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',73);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',17);
return keyIndex < self.keys.length;
    }

    function iterate_next(Post storage self, uint keyIndex) internal      returns (uint) {emit __FunctionCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',7);

emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',77);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',18);
uint r_keyIndex = keyIndex + 1;
emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',78);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',19);
while (r_keyIndex < self.keys.length && self.keys[r_keyIndex].deleted)
            {emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',79);
r_keyIndex++;}
emit __CoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',80);
        emit __StatementCoveragePostMapping('/home/pkro/Kingsland/projects/dapp/contracts/PostMapping.sol',20);
return r_keyIndex;
    }
}
